import React from 'react';

import {
  Typography
} from 'antd';
const { Title, Text } = Typography;

const ContactForm = () => {

  return (
    <Title level={3}>
      Reach out to me <a href="mailto:someone@yoursite.com">Email Us</a>
    </Title>
  );
};

export default ContactForm;
